body,
html {
  font-size: 18px;
  background: #4b21ff;
  font-family: "Barlow Semi Condensed", sans-serif;
  height: 100vh;
}

.primary-btn {
  text-decoration: none;
  background: #4b21ff;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  color: #fefefe;
  padding: 15px 30px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 2.5px;
  cursor: pointer;
  margin-right: 5px;
  transition: all 0.2s ease-in-out;
}
.primary-btn:hover, .primary-btn:focus {
  background: #b4de00;
}

.ghost-btn {
  text-decoration: none;
  border: 4px solid #4b21ff;
  display: inline-block;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  color: #4b21ff;
  padding: 12px 27px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 2.5px;
  transition: all 0.2s ease-in-out;
  cursor: pointer;
}
.ghost-btn:hover, .ghost-btn:focus {
  border-color: #b4de00;
}

.menu-icon {
  font-size: 2rem;
  color: #4b21ff;
  position: fixed;
  right: 36px;
  top: 36px;
  padding: 20px;
  cursor: pointer;
}

#menu {
  background: #4b21ff;
  position: fixed;
  width: 100%;
  transform: translate3d(-100%, 0, 0);
  top: 0;
  bottom: 0;
  z-index: 10;
  display: flex;
  align-items: center;
  justify-content: center;
  opacity: 1;
  transition: all 0.5s ease-in-out;
}
#menu nav {
  width: 400px;
}
#menu nav a {
  display: block;
  text-align: center;
  font-size: 2.3rem;
  padding: 1rem;
  text-decoration: none;
  color: #fefefe;
}
#menu nav a:hover {
  color: #a9a9a9;
}

.menu-active .menu-icon {
  z-index: 11;
}
.menu-active .menu-icon .fa {
  color: #fefefe;
}
.menu-active #menu {
  width: 100%;
  height: 100%;
  top: 0;
  bottom: 0;
  transform: translate3d(0, 0, 0);
}

.scroll-section {
  height: 100vh;
  overflow-y: scroll;
  overflow-x: hidden;
  padding: 56px;
}

